import { Layout, Menu, Breadcrumb } from 'antd';
import { Header } from 'antd/lib/layout/layout';
import { NavLink } from 'react-router-dom';
import styled from 'styled-components';

const LogoContainer = styled.div` 
    position: absolute; 
    display: flex; 
    ` 
 
const LogoBlock = styled.div` 
    display: block; 
    color:white; 
    font-size: 1.5em; 
    height: 100%; 
    vertical-align: centr; 
    height: 62px; 
    line-height: 62px; 
    margin-right: 5px;
    `

function Navbar() {
    return(
      <>
      <LogoContainer> 
                    <NavLink key="home" to="/"> 
                        <LogoBlock><img src="./notes.png" alt={'ads'} height={52}></img> 
                            Note Book
 
                        </LogoBlock> 
                        {/* <LogoBlock> */} 
 
                        {/* </LogoBlock> */} 
                    </NavLink> 
                </LogoContainer>
        <Layout>
        <Header>
        <Menu className="App-header" theme="dark"  mode="horizontal" defaultSelectedKeys={['1']}>
        <Menu.Item key="1" ><NavLink to="/home" >Home Page</NavLink></Menu.Item>
        <Menu.Item key="2">Notes List</Menu.Item>
        <Menu.Item key="3">Statistics</Menu.Item>
      </Menu>
      </Header>
      </Layout>
      </>
    );
}

export default Navbar;
